import random,sys
random.seed()

def send(s):
    print(*s)
    sys.stdout.flush()

# randomly generates a 4-regular graph of size N
# (randomly generating an eulerian cycle)
def gen_4_regular(N):
    Eulerian = list(range(N))+list(range(1,N))
    random.shuffle(Eulerian)
    Eulerian = [0]+Eulerian+[0]
    E = []
    M = [[0]*N for _ in range(N)]
    for i in range(len(Eulerian)-1):
        u,v = Eulerian[i],Eulerian[i+1]
        if u==v or M[u][v]==1:
            return gen_4_regular(N)
        E.append((u+1,v+1))
        M[u][v] = M[v][u] = 1
    return E,M


class Matrice:
    def __init__(self,M):
        self.M = M
        self.m = len(M)
        self.n = len(M[0])
    
    def __getitem__(self,i):
        return self.M[i]
    
    def __mul__(self,A):
        assert(self.n==A.m)
        C = Matrice([[0]*A.n for _ in range(self.m)])
        for i in range(self.m):
            for j in range(A.n):
                for k in range(self.n):
                    C[i][j] += self[i][k]*A[k][j]
        return C
    
    def copy(self):
       return Matrice([self[i][:] for i in range(self.m)])
    
    def __pow__(self,b):
        assert(self.m==self.n)
        result = Matrice([[int(i==j) for j in range(self.n)] for i in range(self.n)])
        A = self.copy()
        while b:
            if b&1:
                result *= A
            A *= A
            b >>= 1
        return result


def sig(M):
    S = M**4  # exponent used for signature
    D = {}
    for u in range(M.n):
        s = tuple(sorted(x for x in S[u] if x!=0))  # signature of a vertex
        if s in D:
            return None
        D[s] = u
    return D

# randomly generates a 4-regular asymmetric graph of size N
# https://en.wikipedia.org/wiki/Asymmetric_graph
def gen_4_asym(N):
    E,M = gen_4_regular(N)
    M = Matrice(M)
    D = sig(M)
    if D==None:
        return gen_4_asym(N)
    return E,D

